def makeGtx(format, mainImage, width, height, mipmaps=None):
    """
    Put together a GTX image from the raw data given.
    `format` should be a member of `Texture.Enums.GX2SurfaceFormat`.
    `mainImage` is the data for the main image, in the format specified.
    `width` and `height` are the width and height of the image, respectively.
    `mipmaps` should be a list containing raw mipmap data, in order of
    descending size (either `[]` or `None` can be used to indicate that the
    GTX should have no mipmaps).
    """

    #                               _   _       _
    #                      /\      | \ | |     | |
    #                     /  \     |  \| | ___ | |_ ___
    #                    / /\ \    | . ` |/ _ \| __/ _ \
    #                   / ____ \   | |\  | (_) | ||  __/
    #                  /_/    \_\  |_| \_|\___/ \__\___|
    #
    # If you're trying to use this function and it's not working and you ended
    # up here: I'm sorry. We just don't know enough about the GTX format yet to
    # write this function properly, so it's horribly hardcoded to a few
    # specific cases. I hate it as much as you. Hopefully this will be
    # improved someday.
    # (ASCII art is from http://patorjk.com/software/taag/ -- font is "Big")

    # We only know how two formats work right now.
    if format is Enums.GX2SurfaceFormat.UNORM_BC3:
        swizzleFunc = _gtxTextureFormats.swizzleBC3
    elif format is Enums.GX2SurfaceFormat.UNORM_R8_G8_B8_A8:
        swizzleFunc = _gtxTextureFormats.swizzleRGBA8
    else:
        raise NotImplementedError('Texture format {} is not supported for GTX encoding yet.'.format(format))

    # Swizzle all the things
    rawData = swizzleFunc(mainImage, width, height)
    rawMipmaps = [swizzleFunc(im, width // (2 ** (i + 1)), height // (2 ** (i + 1))) for i, im in enumerate(mipmaps)]

    # Put the mipmaps together
    mipData = b''.join(rawMipmaps)

    # Padding -- all I have to go off of right now is:
    # 0x0 -> 0x0
    # 0x55500 -> 0x57000
    # Hopefully this is kind of right-ish, given those two cases.
    if mipData:
        goodLen = len(mipData)
        if goodLen % 0x1000:
            goodLen += 0x1000 - (goodLen % 0x1000)
        goodLen += 0x1000

        mipData += b'\0' * (goodLen - len(mipData))
        assert len(mipData) == goodLen


